package aop.service.impl;import aop.domain.ExceptionLogs;import aop.mapper.ExceptionLogsMapper;import aop.service.IExceptionLogsService;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;@Servicepublic class ExceptionLogsServiceImpl implements IExceptionLogsService {    @Autowired    private ExceptionLogsMapper exceptionLogsMapper;    public int insertExceptionLogs(ExceptionLogs exceptionLogs){        return exceptionLogsMapper.insertExceptionLogs(exceptionLogs);    }}